import * as fm from "../fetch";
export class Query {
    static GetCtAccount(req, initReq) {
        return fm.fetchReq(`/seichain/confidentialtransfers/account/${req["address"]}/denom/${req["denom"]}?${fm.renderURLSearchParams(req, ["address", "denom"])}`, { ...initReq, method: "GET" });
    }
    static GetAllCtAccounts(req, initReq) {
        return fm.fetchReq(`/seichain/confidentialtransfers/accounts/${req["address"]}?${fm.renderURLSearchParams(req, ["address"])}`, { ...initReq, method: "GET" });
    }
}
